          <div v-for="(item,index) in titles" : key="item.id" className="pick_jieji" className={pick_active:item.isActive}
          onClick="handleItemtap(index)" data-index="index">
          {{ item.name }}
        </div>
      </div>
      <div className="form_swiper">
        <pick-up v-show="isShow"></pick-up>
        <drop-off v-show="!isShow"></drop-off>
      </div> */}
    </div>
  )
}
